Congress is working on the 2024 fiscal year spending bill now. As it stands, @childrenscause warns the House version of the bill would slash cancer research funding for the first time in over a decade. 
@childrenscause just made it super easy to let your member of Congress know this is NOT OK. Through the 🔗in my stories and bio fill in your name and address and a letter supporting increased cancer research funding, including childhood cancer, will go directly to your member of Congress.
This federal 💰 is literally the difference between cure and no cure, life and death. No need to 👍🏾 this post instead please head to the form 🙏. No one should die from a disease for which there is no research because our government is not prioritizing cancer research funding. 🎗️#cancelchildhoodcancer #teamBlakey
